import React from 'react';

const DriverSessionData = ({ sessionData }) => {
  return (
    <div className="driver-session-data">
      <table>
        <thead>
          <tr>
            <th>Position</th>
            <th>Driver</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {sessionData.map((data, index) => (
            <tr key={index}>
              <td>{data.position}</td>
              <td>{data.driver}</td>
              <td>{data.time}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DriverSessionData;
